import React from 'react';
import './footer.css'

function About(props) {
    return (
        <div className='about'>
            <h1>
                ABOUT
            </h1>
            <p className='info'> Patients with liver disease have been continuously increasing because of excessive consumption of alcohol,
                inhale of harmful gases, intake of contaminated food, pickles and drugs.
                This use case was used to evaluate prediction algorithms in an effort to reduce burden on doctors.
                Early detection of disease can help in devising treatment and preventive strategies for patients,
                developing a solution from a set of defined parameters. </p>
            <footer className="footer">
                <h1>All Rights Reserved To <a href="https://www.virtusa.com/">@VIRTUSA</a></h1>
            </footer>
        </div>


    );
}

export default About;
